(1, '曼雷弗风控基金', 1, '<p class=\"MsoNormal\" align=\"right\" style=\"text-indent:12.0500pt;text-align:right;\">\r\n	<b>&nbsp;صنإندوق إدارة المخاطر (الدولي) مانويل </b><b><span>【</span>MIF<span>】</span></b><b>هو صندوق التحكم في مخاطر تداول الأسهم في العالم (هو مسمى </b><b>MIF</b><b>&nbsp;في التالي)، وإن الحكومة الجزائرية وصندوق الصخرة الألماني وجمعية </b><b>JRT</b><b>&nbsp;المالية الهولندية وأسرة </b><b>R</b><b>·</b><b>BY</b><b>&nbsp;</b><b>السويد، أسرة الكليفلاند الأمريكية هم إستثمرو أربعة مليارات وثمانمائة مليون دولارا لبناء هذا الصندوق.</b><b></b> \r\n</p>\r\n<br />', '2017-08-16 09:20:25', '2017-08-16', 'admin', 1),
(2, '公司资质', 2, '<h1 style=\"text-indent:2em;\">\r\n	<b><span style=\"font-size:24px;color:#9933E5;\"><strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<img src=\"/Public/Admin/js/attached/image/20170822/20170822181457_99467.png\" alt=\"\" /></strong></span></b> \r\n</h1>\r\n<h1 style=\"text-indent:2em;\">\r\n	<b><span style=\"font-size:24px;color:#9933E5;\"><strong> &nbsp;曼雷弗（国际）风控基金【MIF】</strong></span></b> \r\n</h1>\r\n<h1 style=\"text-indent:2em;\">\r\n	<b><span style=\"font-size:24px;color:#9933E5;\"><strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 中华区营业执照</strong></span></b> \r\n</h1>\r\n<p>\r\n	<b><span style=\"font-size:24px;color:#9933E5;\"><strong><img src=\"/Public/Admin/js/attached/image/20170823/20170823152313_26476.jpg\" alt=\"\" /><br />\r\n</strong></span></b> \r\n</p>\r\n<p>\r\n	<b><span style=\"font-size:24px;color:#9933E5;\"><strong>&nbsp; &nbsp; &nbsp;&nbsp;</strong></span></b> \r\n</p>\r\n<h1 style=\"text-indent:2em;\">\r\n	<b><span style=\"color:#9933E5;font-size:24px;\">&nbsp; &nbsp; &nbsp; &nbsp;曼雷弗（国际）风控基金【MIF】</span></b> \r\n</h1>\r\n<div>\r\n	<p style=\"text-indent:48px;\">\r\n		<span><span style=\"font-size:24px;\"><b>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;国际域名证书</b></span></span> \r\n	</p>\r\n	<p>\r\n		<b><span style=\"font-size:24px;color:#9933E5;\"><strong><img src=\"/Public/Admin/js/attached/image/20170823/20170823152335_46746.jpg\" alt=\"\" /><br />\r\n<span style=\"font-size:24px;\"></span></strong></span></b> \r\n	</p>\r\n	<h1 style=\"text-indent:2em;\">\r\n		<b><span style=\"color:#9933E5;font-size:24px;\">&nbsp; &nbsp; &nbsp; 曼雷弗（国际）风控基金【MIF】</span></b> \r\n	</h1>\r\n</div>\r\n<p>\r\n	<br />\r\n</p>\r\n<p style=\"text-indent:48px;\">\r\n	<span><span style=\"font-size:24px;\"><b>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;总部地理位置地标图</b></span></span> \r\n</p>\r\n<p style=\"text-indent:48px;\">\r\n	<span><span style=\"font-size:24px;\"><b><img src=\"/Public/Admin/js/attached/image/20170823/20170823152352_81919.png\" alt=\"\" /><br />\r\n</b></span></span> \r\n</p>\r\n<p style=\"text-indent:48px;\">\r\n	<span><span style=\"font-size:24px;\"><b><br />\r\n</b></span></span> \r\n</p>\r\n<p>\r\n	<b><span style=\"font-size:24px;color:#9933E5;\"><strong></strong></span></b><b><span style=\"font-size:24px;color:#9933E5;\"><strong><span style=\"font-size:24px;\"><br />\r\n<span style=\"font-size:24px;\"></span></span></strong></span></b> \r\n</p>\r\n<p>\r\n	<br />\r\n</p>', '2017-08-23 15:24:02', '2017-08-23', 'admin', 1),
(5, 'Surge tanks—狂飙战车', 3, '<h1>\r\n	&nbsp; Surge tanks\r\n</h1>\r\n<h1>\r\n	&nbsp; &nbsp;狂飙战车<br />\r\n</h1>\r\n<p style=\"text-align:center;\">\r\n	<img src=\"/Public/Admin/js/attached/image/20170822/20170822133443_75438.jpg\" alt=\"\" />\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:justify;\">\r\n	&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<span style=\"font-size:24px;font-family:&quot;\"><strong>狂飙战车隶属于</strong></span><b><span style=\"font-size:24px;font-family:&quot;\"><strong>荷兰</strong></span><span style=\"font-size:24px;font-family:&quot;\"><strong>JRT</strong></span><span style=\"font-size:24px;font-family:&quot;\"><strong>财团，团队主攻南美风投市场操盘，成立于</strong></span><span style=\"font-size:24px;font-family:&quot;\"><strong>2013</strong></span><span style=\"font-size:24px;font-family:&quot;\"><strong>年</strong></span><span style=\"font-size:24px;font-family:&quot;\"><strong>3</strong></span><span style=\"font-size:24px;font-family:&quot;\"><strong>月，最高战绩日复利</strong></span><span style=\"font-size:24px;font-family:&quot;\"><strong>246%</strong></span><span style=\"font-size:24px;font-family:&quot;\"><strong>，打造风控市场狂飙业绩；激情奔放热情，稳健把控市场动向，深受大玩家追捧！</strong></span></b><b></b> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:justify;\">\r\n	<span style=\"font-size:24px;font-family:&quot;\"><strong>The driving force is affiliated to the Dutch JRT consortium, and the team is responsible for the South American vc market operation. It was established in March 2013, with a record high performance of 246%. Passion and dynamic situation, steady control market trend, is very popular with the big players!</strong></span><b></b> \r\n</p>\r\n<span style=\"font-size:24px;font-family:&quot;\"><strong></strong></span> \r\n<p>\r\n	<br />\r\n</p>', '2017-08-22 13:34:47', '2017-08-22', 'admin', 1),
(6, 'MIF分析专家', 4, '<p>\r\n	<span style=\"font-size:32px;\">曼雷弗（国际）风控基金资深分析专家：</span>\r\n</p>\r\n<p>\r\n	<span style=\"font-size:32px;\"><img src=\"/Public/Admin/js/attached/image/20170824/20170824120830_13706.jpg\" alt=\"\" /><br />\r\n</span>\r\n</p>', '2017-08-24 12:08:35', '2017-08-24', 'admin', 1),
(7, '公司简介', 5, '<table class=\"table\" style=\"width:1272px;color:#333333;font-family:Roboto, sans-serif;font-size:16px;\">\r\n	<tbody>\r\n		<tr class=\"info\">\r\n			<th style=\"text-align:left;vertical-align:top;font-size:0.85em;color:#999999;background-color:#D9EDF7;\">\r\n				<p class=\"MsoNormal\" style=\"text-indent:2em;\">\r\n					<span><span style=\"font-size:24px;color:#9933E5;\"><span>&nbsp; 曼雷弗（国际）风控基金【</span></span><span style=\"font-size:24px;color:#9933E5;\"><span>MIF</span></span><span style=\"font-size:24px;color:#9933E5;\"><span>】</span></span></span>\r\n				</p>\r\n				<p class=\"MsoNormal\" style=\"text-indent:2em;\">\r\n					<span>صندوق إدارة المخاطر (الدولي) مانويل</span><span>المقدمة الموجزة</span>\r\n				</p>\r\n				<p class=\"MsoNormal\" style=\"text-indent:2em;\">\r\n					<span><span style=\"font-size:18px;\">曼雷弗（国际）风控基金简称【</span><span style=\"font-size:18px;\">MIF</span><span style=\"font-size:18px;\">】是由阿尔及利亚政府及德国磐石基金、荷兰</span><span style=\"font-size:18px;\">JRT</span><span style=\"font-size:18px;\">财团、瑞典</span><span style=\"font-size:18px;\">R</span></span><span><span style=\"font-size:18px;\">·</span></span><span><span style=\"font-size:18px;\">BY</span><span style=\"font-size:18px;\">家族、美国克利夫兰家族共同出资</span><span style=\"font-size:18px;\">48</span><span style=\"font-size:18px;\">亿美元所组成的全球股权交易风控基金（下称</span></span><span><span style=\"font-size:18px;\">MIF</span><span style=\"font-size:18px;\">）</span></span><span><span style=\"font-size:18px;\">。</span></span><span></span>\r\n				</p>\r\n				<p class=\"MsoNormal\" align=\"right\" style=\"text-indent:2em;text-align:right;\">\r\n					<span><span style=\"font-size:18px;\">إن صندوق إدارة المخاطر (الدولي) مانويل&nbsp;</span></span><span><span style=\"font-size:18px;\">【</span><span style=\"font-size:18px;\">MIF</span><span style=\"font-size:18px;\">】</span></span><span><span style=\"font-size:18px;\">هو صندوق التحكم في مخاطر تداول الأسهم في العالم (هو مسمى&nbsp;</span></span><span><span style=\"font-size:18px;\">MIF</span></span><span><span style=\"font-size:18px;\">&nbsp;في التالي)، وإن الحكومة الجزائرية وصندوق الصخرة الألماني وجمعية&nbsp;</span></span><span><span style=\"font-size:18px;\">JRT</span></span><span><span style=\"font-size:18px;\">&nbsp;المالية الهولندية وأسرة</span></span><span><span style=\"font-size:18px;\">R</span></span><span><span style=\"font-size:18px;\">·</span></span><span><span style=\"font-size:18px;\">BY</span></span><span><span style=\"font-size:18px;\">&nbsp;</span></span><span><span style=\"font-size:18px;\">السويد، أسرة الكليفلاند الأمريكية هم إستثمرو أربعة مليارات وثمانمائة مليون دولارا لبناء هذا الصندوق.</span></span><span></span>\r\n				</p>\r\n				<p class=\"MsoNormal\" align=\"right\" style=\"text-indent:2em;text-align:right;\">\r\n					<span><span style=\"font-size:18px;\">&nbsp;</span></span>\r\n				</p>\r\n				<p class=\"MsoNormal\" style=\"text-indent:2em;\">\r\n					<span><span style=\"font-size:18px;\">MIF</span><span style=\"font-size:18px;\">成立于</span><span style=\"font-size:18px;\">2014</span><span style=\"font-size:18px;\">年</span><span style=\"font-size:18px;\">9</span><span style=\"font-size:18px;\">月，总部位于阿尔及利亚比斯克拉省首府比斯克拉苏埃尔大街</span><span style=\"font-size:18px;\">1698</span><span style=\"font-size:18px;\">号。</span></span><span></span>\r\n				</p>\r\n				<p class=\"MsoNormal\" align=\"right\" style=\"text-indent:2em;text-align:right;\">\r\n					<span><span style=\"font-size:18px;\">إن تأسُس&nbsp;</span></span><span><span style=\"font-size:18px;\">MIF</span></span><span><span style=\"font-size:18px;\">&nbsp;في سبتمبر في عام 2014، ومركزه الرئيسي وقع في رقم 1698 من شارع سيويل من حاضرة محافظة بسكرة&nbsp;</span></span><span><span style=\"font-size:18px;\">–</span></span><span><span style=\"font-size:18px;\">&nbsp;الجزائر.</span></span><span></span>\r\n				</p>\r\n				<p class=\"MsoNormal\" style=\"text-indent:2em;\">\r\n					<span><span style=\"font-size:18px;\">MIF</span><span style=\"font-size:18px;\">目前拥有阿尔及利亚比斯克拉省油田储量</span><span style=\"font-size:18px;\">3864</span><span style=\"font-size:18px;\">万桶，高储量精选钻石矿</span><span style=\"font-size:18px;\">3</span><span style=\"font-size:18px;\">座。主要业务涵盖</span></span><span><span style=\"font-size:18px;\">全球股权交易风控、石油开发、钻石开采、酒店管理、体育博彩等二十几类业务。</span></span><span></span>\r\n				</p>\r\n				<p class=\"MsoNormal\" align=\"right\" style=\"text-align:right;text-indent:2em;\">\r\n					<span><span style=\"font-size:18px;\">يملك&nbsp;</span></span><span><span style=\"font-size:18px;\">MIF</span></span><span><span style=\"font-size:18px;\">&nbsp;ثمانية وثلاثين مليون و ستمائة وأربعين ألف برميلا من النفط من احتياطي النفط في محافظة بسكرة&nbsp;</span></span><span><span style=\"font-size:18px;\">–</span></span><span><span style=\"font-size:18px;\">&nbsp;الجزائر، وثلاثة مناجم الماس المميز الآن ولهم احتياطي الماس الكبير . تضمنت الأعمال الرئيسية الأكثر من عشرين العمل مثل التحكم في مخاطر تداول الأسهم في العالم، واستخراج النفط واستخراج الماس وإدارة الفنادق، الرهان الرياضي وإلخ.</span></span><span></span>\r\n				</p>\r\n				<p class=\"MsoNormal\" style=\"text-indent:2em;\">\r\n					<span><span style=\"font-size:18px;\">MIF</span><span style=\"font-size:18px;\">独创的</span><span style=\"font-size:18px;\">MIF</span><span style=\"font-size:18px;\">数据网络区域链</span></span><span><span style=\"font-size:18px;\">MIF(Memory Initialization File)</span><span style=\"font-size:18px;\">文件是</span></span><span><span style=\"font-size:18px;\">MapInfo</span></span><span><span style=\"font-size:18px;\">通用数据交换格式，这种格式是</span><span style=\"font-size:18px;\">ASCⅡ</span><span style=\"font-size:18px;\">码，可以编辑，容易生成，且可以工作在支持</span><span style=\"font-size:18px;\">MapInfo</span><span style=\"font-size:18px;\">的所有平台上</span></span><span><span style=\"font-size:18px;\">。</span></span><span></span>\r\n				</p>\r\n				<p class=\"MsoNormal\" align=\"right\" style=\"text-indent:2em;text-align:right;\">\r\n					<span><span style=\"font-size:18px;\">إن سلسلة&nbsp;</span></span><span><span style=\"font-size:18px;\">MIF</span></span><span><span style=\"font-size:18px;\">&nbsp;بيانات الشبكة المحلية التي هي مبتكرة من&nbsp;</span></span><span><span style=\"font-size:18px;\">MIF</span></span><span><span style=\"font-size:18px;\">، وثيقة</span></span><span><span style=\"font-size:18px;\">&nbsp;</span></span><span><span style=\"font-size:18px;\">MIF</span></span><span><span style=\"font-size:18px;\">&nbsp;(ملف تهيئة الذاكرة) هي تهيئة</span></span><span><span style=\"font-size:18px;\">MapInfo</span></span><span><span style=\"font-size:18px;\">&nbsp;لتبادل البيانات المشتركة، وهذه التهيئة هي</span></span><span><span style=\"font-size:18px;\">ASC</span></span><span><span style=\"font-size:18px;\">Ⅱ</span></span><span><span style=\"font-size:18px;\">، فممكن أن تحررها ومن السهل توليدها، وبالإضافة إلى ذلك، ممكن أنها مستخدمة في أي سطوح التدعيم</span></span><span><span style=\"font-size:18px;\">MapInfo</span></span><span><span style=\"font-size:18px;\">.</span></span><span></span>\r\n				</p>\r\n				<p class=\"MsoNormal\" style=\"text-indent:2em;\">\r\n					<span><span style=\"font-size:18px;\">通过</span></span><span><span style=\"font-size:18px;\">MIF</span><span style=\"font-size:18px;\">旗下各大财团高级理财风控专家团队每天精准分析，遴选出全球</span><span style=\"font-size:18px;\">34</span><span style=\"font-size:18px;\">个国家股权交易市场绩优股权进行操作交易，实现基金投资客财富增值，进一步提升风控基金的稳健运营，降低交易风险！</span></span><span></span>\r\n				</p>\r\n				<p class=\"MsoNormal\" align=\"right\" style=\"text-align:right;text-indent:2em;\">\r\n					<span><span style=\"font-size:18px;\">اختيار الأسهم ذات الجودة العالية من سوق الأسهم من 34 دولة في جميع أنحاء العالم لتداول الأسهم وفقا للتحليل الدقيق اليومي من فريق كبار الخبراء من الجمعيات المالية ل</span></span><span><span style=\"font-size:18px;\">MIF</span></span><span><span style=\"font-size:18px;\">&nbsp;لمراقبة المخاطر المالية، الأمر الذي يؤدي إلى المستثمرين يزيدون الثروة، ويقوي إجراء العملية السلمية للحد من مخاطر الصندوق، ويقلل مخاطر الصفقة!</span></span><span></span>\r\n				</p>\r\n				<p class=\"MsoNormal\" style=\"text-indent:2em;\">\r\n					<span><span style=\"font-size:18px;\">2017</span><span style=\"font-size:18px;\">年</span><span style=\"font-size:18px;\">6</span><span style=\"font-size:18px;\">月，</span><span style=\"font-size:18px;\">MIF</span><span style=\"font-size:18px;\">正式启动中华区（含中国、东南亚、朝鲜半岛、日本、印度等）交易市场。并委托位于中国（四川）自由贸易实验区成都高新区吉泰五路</span><span style=\"font-size:18px;\">88</span><span style=\"font-size:18px;\">号</span><span style=\"font-size:18px;\">3</span><span style=\"font-size:18px;\">栋</span><span style=\"font-size:18px;\">9</span><span style=\"font-size:18px;\">层</span><span style=\"font-size:18px;\">5</span><span style=\"font-size:18px;\">号的成都曼雷弗网络科技有限公司负责中华区网络维护、市场巡查、会员管理、基金定投发放等相关业务。</span></span><span></span>\r\n				</p>\r\n				<p class=\"MsoNormal\" align=\"right\" style=\"text-align:right;text-indent:2em;\">\r\n					<span><span style=\"font-size:18px;\">يونيو في عام 2017، فتح&nbsp;</span></span><span><span style=\"font-size:18px;\">MIF</span></span><span><span style=\"font-size:18px;\">&nbsp;السوف في منطقة آسيا(من ضمنها الصين وجنوب سرق آسي وشبه الجزيرة الكورية واليابان والهند وإلخ). ثم أسند شركة مانويل الشبكة والتكنولوجيا المحدودة بتشنغدو التي موقعها في الغرفة 5 الطابق 9 العمارة 3 رقم 88 من شارع جي تاي الخامس&nbsp;</span></span><span><span style=\"font-size:18px;\">–</span></span><span><span style=\"font-size:18px;\">الحي العالي والجديد بتشنغدو&nbsp;</span></span><span><span style=\"font-size:18px;\">–</span></span><span><span style=\"font-size:18px;\">&nbsp;منطقة التجارة الحرة التجريبية&nbsp;</span></span><span><span style=\"font-size:18px;\">–</span></span><span><span style=\"font-size:18px;\">&nbsp;(سيتشوان) الصين لمسؤولة عن صيانة الشبكة في منطقة آسيا، وتفتيش السوق وإدارة الأعضاء وقرارات إستخدام الموارد المالية والأعمال الأخرى المتعلقة.</span></span>\r\n				</p>\r\n				<p class=\"MsoNormal\" align=\"right\" style=\"text-align:right;text-indent:2em;\">\r\n					<span><span style=\"font-size:24px;\">曼雷弗（国际）风控基金：</span></span><span><span style=\"font-size:24px;\">您身边的财富增值天使，期待与</span></span><span><span style=\"font-size:24px;\">您扬帆起航</span><span style=\"font-size:24px;\">!!!</span></span><span><span style=\"font-size:24px;\">&nbsp;&nbsp;</span>&nbsp; &nbsp; &nbsp;&nbsp;</span>\r\n				</p>\r\n				<div>\r\n					<span><br />\r\n</span>\r\n				</div>\r\n			</th>\r\n		</tr>\r\n	</tbody>\r\n</table>', '2017-08-16 09:55:01', '2017-08-16', 'admin', 1),
(17, 'Diamond light——钻石之光', 3, '<h1>\r\n	<span style=\"color:#9933E5;\">&nbsp; &nbsp; Diamond light——钻石之光</span><span style=\"color:#9933E5;\"></span><br />\r\n</h1>\r\n<p>\r\n	<span style=\"color:#9933E5;\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<img src=\"/Public/Admin/js/attached/image/20170823/20170823155004_85017.jpg\" alt=\"\" /><br />\r\n</span> \r\n</p>\r\n<p>\r\n	<span style=\"color:#9933E5;\"> </span> \r\n</p>\r\n<h1>\r\n	<span style=\"color:#333333;\">&nbsp; <strong>&nbsp;&nbsp;\r\n	<h1>\r\n		<span style=\"color:#333333;\">&nbsp;Diamond light——钻石之光 &nbsp; &nbsp; &nbsp;</span><span style=\"color:#333333;\"><span style=\"font-size:24px;\">团队隶属于</span></span><span style=\"font-size:24px;\">阿尔及利亚政府金融智囊机构，主要负责矿</span><span style=\"font-size:24px;\">产石油类交易市场分析，具有敏锐的市场前瞻性和风险把控能力，以犀利、果断和较强</span>\r\n		<p>\r\n			<span style=\"font-size:24px;\">的执行力而著称！！</span>\r\n		</p>\r\n	</h1>\r\n</strong></span>\r\n</h1>\r\n<h1>\r\n	<span style=\"color:#333333;\"><strong> </strong></span> \r\n</h1>', '2017-08-23 17:04:37', '2017-08-23', 'admin', 1),
